import React from 'react';

const Home = () => {
	return (
		<div>
			<div className='row'>
				<header className="App-header">
					<p>Hello, I am Manish Mallik!</p>
				</header>
				<p>I am a computer science major at the University of Texas at Dallas!</p>
			</div>
		</div>
	);
};

export default Home;
